import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open a product modal by clicking a product card (simulate user action)
    // Wait for a product card to appear
    await page.waitForSelector('.product-card', { timeout: 5000 });
    // Click the first product card to open the modal
    await page.click('.product-card');

    // Wait for the modal to appear (modal has id="productModal" and style.display='block')
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 5000 });
    // Wait for modal content to be fully loaded
    await page.waitForSelector('.product-detail-info', { timeout: 5000 });

    // Take screenshot of modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Press Escape key to close the modal
    await page.keyboard.press('Escape');

    // Wait for the modal to be closed (style.display='none')
    await page.waitForFunction(() => {
      const modal = document.getElementById('productModal');
      return modal && (modal.style.display === '' || modal.style.display === 'none');
    }, { timeout: 3000 });

    // Take screenshot after modal is closed
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    // Extract data to verify modal is closed
    const modalDisplay = await page.evaluate(() => {
      const modal = document.getElementById('productModal');
      return modal ? modal.style.display : null;
    });

    return {
      success: modalDisplay === '' || modalDisplay === 'none',
      action: "Closed product modal with Escape key",
      extractedData: {
        modalDisplay
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
